# Retry Configuration
MAX_RETRIES = 10
RETRY_DELAY = 30  # Seconds to wait between retries

# Function to download a single file with retry logic
# Function to download a single file with retry logic
def download_audio(url, folder, progress_lock, progress):
    filename = os.path.basename(url.split("?")[0])  # Remove query parameters
    file_path = os.path.join(folder, filename)

    # Check if the file already exists
    if os.path.exists(file_path):
        print(f"  Skipping download (file exists): {filename}")
        with progress_lock:
            progress["completed"] += 1
            percentage = (progress["completed"] / progress["total"]) * 100
            print(f"  Progress [{progress['category']}]: {percentage:.2f}% completed ({progress['completed']}/{progress['total']})")
        return  # Skip further execution

    attempts = 0
    while attempts < MAX_RETRIES:
        try:
            attempts += 1
            print(f"  Attempt {attempts}: Starting download: {filename}")
            response = requests.get(url, stream=True, timeout=30)
            response.raise_for_status()  # Raise HTTPError for bad responses

            # Save the file
            with open(file_path, "wb") as file:
                for chunk in response.iter_content(chunk_size=8192):
                    file.write(chunk)

            print(f"  Completed: {filename}")
            with progress_lock:
                progress["completed"] += 1
                percentage = (progress["completed"] / progress["total"]) * 100
                print(f"  Progress [{progress['category']}]: {percentage:.2f}% completed ({progress['completed']}/{progress['total']})")
            return  # Exit the function on success
        except requests.exceptions.RequestException as e:
            print(f"  Failed attempt {attempts} for {filename}: {e}")
            if attempts < MAX_RETRIES:
                print(f"  Retrying in {RETRY_DELAY} seconds...")
                sleep(RETRY_DELAY)  # Wait before retrying
            else:
                print(f"  Giving up after {MAX_RETRIES} attempts: {filename}")


# Function to download files for a specific category
def download_category(category_name, urls):
    print(f"\nStarting downloads for category: {category_name}")
    folder_path = category_name  # Use the dictionary key as the folder name
    os.makedirs(folder_path, exist_ok=True)  # Create the folder if it doesn't exist

    # Progress tracking
    progress_lock = Lock()
    progress = {"category": category_name, "completed": 0, "total": len(urls)}

    # Start download tasks
    with ThreadPoolExecutor(max_workers=11) as executor:  # Up to 7 threads for this category
        futures = [executor.submit(download_audio, url, folder_path, progress_lock, progress) for url in urls]
        for future in as_completed(futures):
            future.result()  # Wait for all threads to complete

    print(f"Completed downloads for category: {category_name}")

